import React from 'react';

const VideoItem = ({video}) => {
    console.log(video)
    const thumbnail = video.snippet.thumbnails.default.url
    return (
        <div>
            <img src={thumbnail} />
            {video.snippet.title}
        </div>
    )
}

export default VideoItem;
